        </IonItem>
        <IonItem>
          <img v-if="place?.imageBase64" :src="place.imageBase64" alt="Zdjęcie miejsca" style="max-width: 300px; border-radius: 10px;">
        </IonItem>
        <IonItem>
          <p><strong>Data:</strong> {{ place?.date }}</p>
          <p><strong>Lokalizacja:</strong> {{ place?.localization.latitude }}, {{ place?.localization.longitude }}</p>
        </IonItem>
        <IonItem>
          <button class="button" @click="goBack()">
            Cofnij
          </button>
        </IonItem>
      </div>
    </ion-content>
  </ion-page>
</template>

<script setup lang="ts">
import { IonPage, IonHeader, IonToolbar, IonTitle, IonContent, IonItem } from '@ionic/vue';
import ExploreContainer from '@/components/ExploreContainer.vue';
import { Place } from '@/types/place';
import { ref, onMounted } from 'vue';
import { useRoute } from 'vue-router';
import { useRouter } from 'vue-router';
import { Filesystem, Directory, Encoding } from '@capacitor/filesystem';

const route = useRoute();
const router = useRouter();

const places = ref<Place[]>([]);
const place = ref<Place | null>(null);
/*
