  },
  {
    name: 'Horizon',
    description: 'yeaaa',
    imageBase64: 'data:image/jpeg;base64,',  // Zdjęcie w formacie Base64
    date: '2024-12-24',
    localization: { latitude: 51.5073509, longitude: -0.1277583 },
  },
  {
    name: 'AB',
    description: 'abns',
    imageBase64: 'data:image/jpeg;base64,',  // Zdjęcie w formacie Base64
    date: '2024-12-25',
    localization: { latitude: 48.856614, longitude: 2.3522219 },
  }
];
*/

const goBack = () => {
  router.push('/tabs/tab2');
};

async function loadEntry(fileName: string): Promise<Place | null> {
  try {
    const result = await Filesystem.readFile({
      path: `entries/${fileName}`, // Ścieżka pliku
      directory: Directory.Data, // Directory.Data dla poprawnej lokalizacji na urządzeniach mobilnych
      encoding: Encoding.UTF8,
    });

    return JSON.parse(result.data) as Place;
  } catch (error) {
    console.error('Błąd podczas odczytywania danych:', error);
    return null;
  }
}

async function loadAllEntries(): Promise<void> {
  try {
    const files = await Filesystem.readdir({
      path: 'entries', // Folder 'entries'
      directory: Directory.Data,
    });

    const entries: Place[] = await Promise.all(
      files.files.map(async (fileName: string) => {
        const entry = await loadEntry(fileName);
        return entry;
      })
    );

    // Przypisujemy tylko te elementy, które nie są null
    places.value = entries.filter((entry): entry is Place => entry !== null);
  } catch (error) {
    console.error('Błąd podczas ładowania wszystkich wpisów:', error);
    places.value = [];
  }
}

onMounted(() => {
  loadAllEntries();
  const placeName = route.params.name as string;
  place.value = places.value.find((p) => p.name === placeName) || null;
});
</script>

